import Card from './Card';
import data from './Services_data';     //importing data from services_data.jsx 


function start(val){
    return(
        <Card   //calling card component
            name1={val.name}
            image1={val.image}
        />
    )
        
}

const Skills = () => {
  return (
    <>
    <div className='dibba'>
        {/* {data.map(start)}      */}
        {/* using map method for getting all the data in services_data */}


        
      {/* <Cards name='sid' img='images/download.png'/>
      <Cards name='sid1' img='images/images.jpg'/>
      <Cards name='sid2' img='images/download.png'/> */}

      {data.map((val,ind,arr)=>{
        return <Card name={val.name} img={val.img} />
      })}

    </div>
    </>
  )
}

export default Skills
